import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import CarList from './Components/CarList';
import MyComponent from './Components/CarList';
import Home from './Components/Home';
import './App.css';

function App() {
  return (
      <div className="App">
        <header>
          <h1>Dealer Auto</h1>
          <p>Cele mai bune oferte de mașini noi și rulate!</p>
        </header>
        <main>
            <Router>
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/my-page" element={<MyComponent />} />
                </Routes>
            </Router>
          <CarList />
        </main>
        <footer>
          <p>&copy; 2024 Dealer Auto. Toate drepturile rezervate.</p>
        </footer>
      </div>
  );
}

export default App;
